import './Square.css';
import React from 'react';

class Square extends React.Component {
  render(){
    const classes = "square" + (this.props.isDark ? " dark" : " light");
    return (
      <td onClick={() => console.log(this.props.piece)} className={classes}>
        <img src="./images/w_k.png"></img>
      </td>
    );
  }
}

export default Square;
